def draw_background():
    for i in range(20):
        blue_value = 180 + i * 4
        if blue_value > 255:
            blue_value = 255
        color = f'#0011{blue_value:02x}'
        y_start = i * (screen_height // 20)
        y_end = (i + 1) * (screen_height // 20)
        canvas.create_rectangle(0, y_start, screen_width, y_end, fill=color, outline="")

