def reset_game_variables_for_level():
    global player_y, player_vel, jump_count, bullets, equations, powerups
    global score, lives, countdown, equations_solved, game_running
    global slow_time_active, double_points_active, powerup_timers, boss, boss_spawned
    player_y = screen_height - PLAYER_SIZE - GROUND_HEIGHT
    player_vel = 0
    jump_count = 0
    bullets.clear()
    equations.clear()
    powerups.clear()
    score = 0
    equations_solved = 0
    slow_time_active = False
    double_points_active = False
    powerup_timers.clear()
    boss = None
    boss_spawned = False
    if level == 1:
        lives = 3
        countdown = 60
    elif level == 2:
        lives = 5
        countdown = 90
    game_running = False

def start_game(start_level):
    global level, game_running
    level = start_level
    reset_game_variables_for_level()
    game_running = True
    spawn_equation()
    spawn_powerup()
    start_timer()
    game_loop()

def start_timer():
    global countdown, timer_id
    if not game_running:
        return
    if countdown > 0:
        countdown -= 1
        interval = 1000 if not slow_time_active else 2000
        timer_id = root.after(interval, start_timer)
    else:
        if game_running:
            game_over_screen("⏱️ Time's up! Try again.")

def spawn_equation():
    if not game_running:
        return
    operators_level_1 = ['+', '-', '*', '/']
    operators_level_2 = ['+', '-', '*', '/', '^']
    eq_text = ""
    answer = 0
    if level == 1:
        op = random.choice(operators_level_1)
        if op == '+':
            a = random.randint(10, 50)
            b = random.randint(10, 50)
            answer = a + b
        elif op == '-':
            a = random.randint(20, 60)
            b = random.randint(1, a)
            answer = a - b
        elif op == '*':
            a = random.randint(2, 12)
            b = random.randint(2, 10)
            answer = a * b
        elif op == '/':
            b = random.randint(2, 10)
            answer = random.randint(2, 10)
            a = answer * b
        eq_text = f"{a} {op} {b}"
    elif level == 2:
        eq_type = random.choice(['basic', 'power', 'algebra', 'brackets'])
        if eq_type == 'basic':
            op = random.choice(operators_level_1)
            if op == '+':
                a = random.randint(50, 100)
                b = random.randint(30, 80)
                answer = a + b
            elif op == '-':
                a = random.randint(50, 100)
                b = random.randint(20, a)
                answer = a - b
            elif op == '*':
                a = random.randint(5, 15)
                b = random.randint(5, 15)
                answer = a * b
            elif op == '/':
                b = random.randint(2, 12)
                answer = random.randint(5, 15)
                a = answer * b
            eq_text = f"{a} {op} {b}"
        elif eq_type == 'power':
            base = random.randint(2, 5)
            exp = random.randint(2, 3)
            answer = base ** exp
            eq_text = f"{base}^{exp}"
        elif eq_type == 'algebra':
            a = random.randint(1, 5)
            x = random.randint(1, 10)
            b = random.randint(1, 20)
            c = a * x + b
            answer = x
            eq_text = f"{a}x + {b} = {c}"
        elif eq_type == 'brackets':
            a = random.randint(1, 10)
            b = random.randint(1, 10)
            c = random.randint(1, 10)
            op1 = random.choice(['+', '-'])
            op2 = random.choice(['+', '-'])
            inner = b + c if op1 == '+' else b - c
            answer = a + inner if op2 == '+' else a - inner
            eq_text = f"{a} {op2} ({b} {op1} {c})"
    x = random.randint(screen_width // 2, screen_width - 150)
    y = random.randint(100, screen_height - 150)
    equations.append({"text": eq_text, "answer": answer, "x": x, "y": y})

def spawn_powerup():
    if not game_running:
        return
    types = ['extra_life', 'slow_time', 'double_points']
    ptype = random.choice(types)
    x = random.randint(screen_width//2, screen_width - 100)
    y = random.randint(100, screen_height - 150)
    powerups.append({"type": ptype, "x": x, "y": y, "size": 40, "vx": -3})
    root.after(random.randint(10000, 20000), spawn_powerup)

def fire_bullet():
    bullets.append({"x": 100 + PLAYER_SIZE, "y": int(player_y) + PLAYER_SIZE // 2})

def jump():
    global jump_count, player_vel
    if jump_count < MAX_JUMPS:
        player_vel = JUMP_STRENGTH
        jump_count += 1

def key_handler(event):
    if event.keysym == "Escape":
        root.destroy()
    if not game_running:
        return
    try:
        if event.keysym.lower() == "space":
            jump()
        if event.char.lower() == "f":
            fire_bullet()
    except Exception:
        pass

def create_burst(x, y):
    particles = []
    for _ in range(15):
        angle = random.uniform(0, 2 * math.pi)
        speed = random.uniform(4, 10)
        dx = speed * math.cos(angle)
        dy = speed * math.sin(angle)
        particles.append({
            "x": x, "y": y, "dx": dx, "dy": dy,
            "radius": random.randint(5, 10), "life": 15
        })
    bursts.append(particles)

def update_and_draw_bursts():
    for burst in bursts[:]:
        for p in burst[:]:
            p["x"] += p["dx"]
            p["y"] += p["dy"]
            p["dy"] += 0.5
            p["radius"] -= 0.3
            p["life"] -= 1
            if p["radius"] <= 0 or p["life"] <= 0:
                burst.remove(p)
        if not burst:
            bursts.remove(burst)
        else:
            for p in burst:
                canvas.create_oval(p["x"]-p["radius"], p["y"]-p["radius"],
                    p["x"]+p["radius"], p["y"]+p["radius"], fill="yellow", outline="")

def update_powerup_timers():
    global slow_time_active, double_points_active
    now = int(time.time() * 1000)
    for ptype in list(powerup_timers):
        if powerup_timers[ptype] < now:
            if ptype == "slow_time":
                slow_time_active = False
            elif ptype == "double_points":
                double_points_active = False
            del powerup_timers[ptype]

def apply_powerup(ptype):
    global lives, slow_time_active, double_points_active, powerup_timers
    now = int(time.time() * 1000)
    if ptype == "extra_life":
        max_lives = 3 if level == 1 else 5
        if lives < max_lives:
            lives += 1
    elif ptype == "slow_time":
        slow_time_active = True
        powerup_timers["slow_time"] = now + POWERUP_DURATION
    elif ptype == "double_points":
        double_points_active = True
        powerup_timers["double_points"] = now + POWERUP_DURATION

