def create_huge_burst():
    burst_particles = []
    x, y = screen_width // 2, screen_height // 2
    for _ in range(120):  # many particles for huge burst
        angle = random.uniform(0, 2 * math.pi)
        speed = random.uniform(8, 18)
        dx = speed * math.cos(angle)
        dy = speed * math.sin(angle)
        burst_particles.append({
            "x": x, "y": y, "dx": dx, "dy": dy,
            "radius": random.randint(16, 28), "life": random.randint(18, 28),
            "color": random.choice(["yellow", "red", "magenta", "orange", "cyan", "white"])
        })
    def animate_burst():
        canvas.delete("burst_anim")
        for p in burst_particles[:]:
            p["x"] += p["dx"]
            p["y"] += p["dy"]
            p["dy"] += 0.6
            p["radius"] -= 0.4
            p["life"] -= 1
            color = p["color"]
            if p["radius"] <= 0 or p["life"] <= 0:
                burst_particles.remove(p)
            else:
                canvas.create_oval(
                    p["x"]-p["radius"], p["y"]-p["radius"],
                    p["x"]+p["radius"], p["y"]+p["radius"],
                    fill=color, outline="", tags="burst_anim"
                )
        if burst_particles:
            root.after(18, animate_burst)
        else:
            show_arnav_text_then_surprise()
    animate_burst()

def game_over_screen(message):
    global game_running
    game_running = False
    canvas.delete("all")
    draw_background()
    canvas.create_text(screen_width//2, screen_height//2 - 80,
        text=message, fill="red", font=("Comic Sans MS", 48, "bold"))
    btn_retry = tk.Button(root, text="Try Again", font=("Comic Sans MS", 28, "bold"),
                          command=lambda: start_game(level), bg="#00aaff", fg="white", relief="raised", bd=6, padx=25, pady=12, activebackground="#0077cc")
    canvas.create_window(screen_width//2, screen_height//2 + 40, window=btn_retry)
    btn_exit = tk.Button(root, text="Exit", font=("Comic Sans MS", 28, "bold"),
                          command=root.destroy, bg="#cc3300", fg="white", relief="raised", bd=6, padx=25, pady=12, activebackground="#992200")
    canvas.create_window(screen_width//2, screen_height//2 + 110, window=btn_exit)

def game_loop():
    global player_y, player_vel, jump_count, bullets, equations, lives, score, equations_solved, game_running
    global boss, boss_spawned
    if not game_running:
        return
    canvas.delete("all")
    draw_background()
    canvas.create_rectangle(0, screen_height - GROUND_HEIGHT, screen_width, screen_height, fill="#004466")
    # Draw player
    if hi_img:
        canvas.create_image(100, int(player_y), image=hi_img, anchor="nw")
    else:
        canvas.create_rectangle(100, int(player_y), 100 + PLAYER_SIZE, int(player_y) + PLAYER_SIZE, fill="#00cc44")
    # Apply gravity & player position update
    player_vel += GRAVITY
    player_y += player_vel
    if player_y > screen_height - PLAYER_SIZE - GROUND_HEIGHT:
        player_y = screen_height - PLAYER_SIZE - GROUND_HEIGHT
        player_vel = 0
        jump_count = 0
    b_w = bullet_img.width() if bullet_img else 12
    b_h = bullet_img.height() if bullet_img else 12
    # Handle bullets & collision with equations or boss
    for bullet in bullets[:]:
        bullet["x"] += BULLET_SPEED
        if bullet_img:
            canvas.create_image(bullet["x"], bullet["y"], image=bullet_img, anchor="nw")
        else:
            canvas.create_oval(bullet["x"], bullet["y"], bullet["x"] + 12, bullet["y"] + 12, fill="orange")
        if bullet["x"] > screen_width:
            bullets.remove(bullet)
            continue
        # Bullets hit boss if spawned
        if boss_spawned and boss:
            if (bullet["x"] + b_w >= boss["x"] and bullet["x"] <= boss["x"] + boss["width"] and
                bullet["y"] + b_h >= boss["y"] and bullet["y"] <= boss["y"] + boss["height"]):
                try:
                    bullets.remove(bullet)
                except ValueError:
                    pass
                boss["hp"] -= 1
                create_burst(boss["x"] + boss["width"] // 2, boss["y"] + boss["height"] // 2)
                if boss["hp"] <= 0:
                    global score
                    boss = None
                    show_final_win_screen()
                    return
        elif not boss_spawned:
            # Bullets hit normal equations if boss not spawned
            for eq in equations[:]:
                eq_x, eq_y = eq["x"], eq["y"]
                if (bullet["x"] + b_w >= eq_x and bullet["x"] <= eq_x + 150 and
                    bullet["y"] + b_h >= eq_y and bullet["y"] <= eq_y + 40):
                    try:
                        equations.remove(eq)
                    except ValueError:
                        pass
                    try:
                        bullets.remove(bullet)
                    except ValueError:
                        pass
                    create_burst(eq_x + 75, eq_y + 20)
                    equations_solved += 1
                    points_gained = 10
                    if double_points_active:
                        points_gained *= 2
                    score += points_gained
                    spawn_equation()
                    break
    # Move and draw normal equations only if boss not spawned
    if not boss_spawned:
        speed = 3 if not slow_time_active else 1
        for eq in equations[:]:
            eq["x"] -= speed
            if eq["x"] < 0:
                try:
                    equations.remove(eq)
                except ValueError:
                    pass
                lives -= 1
                spawn_equation()
                if lives <= 0:
                    game_over_screen("💀 You lost all lives! Try again.")
                    return
        for eq in equations:
            canvas.create_rectangle(eq["x"], eq["y"], eq["x"] + 150, eq["y"] + 40, fill="#202040", outline="white", width=2)
            canvas.create_text(eq["x"] + 75, eq["y"] + 20, text=eq["text"], fill="white", font=("Arial", 22, "bold"))
    # Boss spawning at 15 equations solved on level 2
    if level == 2 and not boss_spawned and equations_solved >= 15:
        boss_spawned = True
        boss = {
            "x": screen_width - 350,
            "y": screen_height // 2 - 60,
            "width": 350,
            "height": 120,
            "hp": 20,
            "text": "3 sin(2x) - 4 cos²(x) + 5 = ?"
        }
        equations.clear()
    # Move and draw boss if spawned
    if boss:
        boss["x"] -= 2 if not slow_time_active else 1
        canvas.create_rectangle(boss["x"], boss["y"],
                                boss["x"] + boss["width"], boss["y"] + boss["height"],
                                fill="darkred", outline="yellow", width=25)
        canvas.create_text(boss["x"] + boss["width"] // 2, boss["y"] + boss["height"] // 2,
                           text=boss["text"], fill="white", font=("Arial", 28, "bold"))
        # Boss crosses player → lose all lives and game over
        if boss["x"] <= 150:
            lives = 0
            game_over_screen("💀 The Boss defeated you! All lives lost.")
            return
    # Powerups
    for p in powerups[:]:
        p["x"] += p["vx"]
        if p["x"] < -50:
            powerups.remove(p)
            continue
        px1, py1 = 100, int(player_y)
        px2, py2 = px1 + PLAYER_SIZE, py1 + PLAYER_SIZE
        if (p["x"] + p["size"] > px1 and p["x"] < px2 and
            p["y"] + p["size"] > py1 and p["y"] < py2):
            apply_powerup(p["type"])
            try:
                powerups.remove(p)
            except ValueError:
                pass
    for p in powerups:
        if p["type"] == "extra_life":
            color = "lime"
            symbol = "+"
        elif p["type"] == "slow_time":
            color = "blue"
            symbol = "S"
        else:
            color = "gold"
            symbol = "2x"
        canvas.create_oval(p["x"], p["y"], p["x"] + p["size"], p["y"] + p["size"], fill=color, outline="white", width=3)
        canvas.create_text(p["x"] + p["size"] // 2, p["y"] + p["size"] // 2, text=symbol, fill="black", font=("Arial", 20, "bold"))
    # HUD
    canvas.create_text(160, 50, text=f"Score: {score}", fill="white", font=("Arial", 32, "bold"))
    canvas.create_text(160, 100, text=f"Lives: {lives}", fill="white", font=("Arial", 32, "bold"))
    canvas.create_text(screen_width - 180, 50, text=f"Time: {countdown}s", fill="white", font=("Arial", 32, "bold"))
    bar_x, bar_y, bar_w, bar_h = 20, 120, 200, 30
    canvas.create_rectangle(bar_x, bar_y, bar_x + bar_w, bar_y + bar_h, fill="red", outline="white", width=3)
    max_lives = 3 if level == 1 else 5
    if lives > 0:
        canvas.create_rectangle(bar_x, bar_y, bar_x + (bar_w * lives / max_lives), bar_y + bar_h, fill="lime", outline="")
    update_and_draw_bursts()
    update_powerup_timers()
    # Level 1 win check
    if score >= 100 and level == 1:
        show_win_screen_level1()
        return
    # Level 2 win check (only if boss defeated)
    if level == 2 and not boss and boss_spawned:
        show_final_win_screen()
        return
    root.after(30, game_loop)

# Bind keys and start
root.bind("<Key>", key_handler)
show_start_screen()
root.mainloop()
